  American Breeding Bird Survey at Fish Springs National Wildlife Refuge.   This survey
  is conducted annually between May 22nd and June 30th and is part of a long-term
  nation-wide breeding bird monitoring effort lead by the USGS Patuxent Wildlife Research
  Center with the assistance of a local State Coordinator. The designated route that
  runs through the Refuge is Breeding Bird Survey (BBS) route 85159 u2013 u2018Callaou2019.
